import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light" style={{ height: 60, clear: "both", paddingTop: 20, textAlign: "center" }}>
      <a className="navbar-brand" href="/">
        Recipe Reading App
      </a>
    </nav>
  );
}

export default Nav;
